import React, { useState } from 'react';
import './App.css';
import Navbar from './components/Navbar';

function App() {

  const [currentState, setState] = useState("home");

  function navbarState(newState){
    setState(newState);
  }

  return (
    <div className="App">
      <Navbar onFunction={navbarState}></Navbar>
    </div>
  );
}

export default App;
